import React from 'react';
// import App from './App';
import './css/home.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { Link } from "react-router-dom";
import Navbar from '../Navbar'

// import '@fortawesome/fontawesome-free/css/all.min.css'; 
<head>
  <style>
  @import url('https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap');
  </style>
</head>

export default function Homepage() {
  return (

    <div className="body">
      <Navbar />
      {/* Header */}
      <header className="main-header">
        <h1 className="header1">Time Capsule 2.0</h1>
      </header>

      {/* Hero Section */}
      <section className="content">
        <h2 className="content1">Preserve Your Memories for the Future</h2>
        <p className="content2">Store messages, photos, and secrets in a digital time capsule and unlock them when the time is right.</p>
      </section>
      <div className="photos">
        <div className='photo1-container'><img className="photo1" src = "https://i.imgur.com/IedkRF3.jpeg" alt = "pic1" /></div>
        <div className='photo2-container'><img className="photo2" src="https://themesflat.co/html/open9/assets/images/box-item/banner-01.jpg" alt="pic2"/></div>
        <div className='photo3-container'><img className="photo3" src="https://i.imgur.com/7Ylq3Gt.jpeg" alt="pic3" /></div>
        <div className='photo4-container'><img className='photo4' src="https://i.imgur.com/ola3ejE.jpeg"alt="pic4"/></div>
        <div className='photo5-container'><img className='photo5' src="https://i.imgur.com/hLit3EB.jpeg"alt="pic5"/></div>
      </div>

      {/* Goals Section */}
      <div className="footer">
        <div className="column1">
          <div className="goals">Our Goals</div>
          <li>Enable users to securely store their messages and photos.</li>
          <li>Provide a time-lock feature for future retrieval.</li>
          <li>Ensure privacy and security through encrypted storage.</li>
          <li>Make memory sharing meaningful and exciting.</li>
        </div>
        <div className="column2">
          <div className="youtube">
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 576 512"><path d="M549.7 124.1c-6.3-23.7-24.8-42.3-48.3-48.6C458.8 64 288 64 288 64S117.2 64 74.6 75.5c-23.5 6.3-42 24.9-48.3 48.6-11.4 42.9-11.4 132.3-11.4 132.3s0 89.4 11.4 132.3c6.3 23.7 24.8 41.5 48.3 47.8C117.2 448 288 448 288 448s170.8 0 213.4-11.5c23.5-6.3 42-24.2 48.3-47.8 11.4-42.9 11.4-132.3 11.4-132.3s0-89.4-11.4-132.3zm-317.5 213.5V175.2l142.7 81.2-142.7 81.2z"/></svg>
          </div>
          <div className='instagram'>
          <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 448 512"><path d="M224.1 141c-63.6 0-114.9 51.3-114.9 114.9s51.3 114.9 114.9 114.9S339 319.5 339 255.9 287.7 141 224.1 141zm0 189.6c-41.1 0-74.7-33.5-74.7-74.7s33.5-74.7 74.7-74.7 74.7 33.5 74.7 74.7-33.6 74.7-74.7 74.7zm146.4-194.3c0 14.9-12 26.8-26.8 26.8-14.9 0-26.8-12-26.8-26.8s12-26.8 26.8-26.8 26.8 12 26.8 26.8zm76.1 27.2c-1.7-35.9-9.9-67.7-36.2-93.9-26.2-26.2-58-34.4-93.9-36.2-37-2.1-147.9-2.1-184.9 0-35.8 1.7-67.6 9.9-93.9 36.1s-34.4 58-36.2 93.9c-2.1 37-2.1 147.9 0 184.9 1.7 35.9 9.9 67.7 36.2 93.9s58 34.4 93.9 36.2c37 2.1 147.9 2.1 184.9 0 35.9-1.7 67.7-9.9 93.9-36.2 26.2-26.2 34.4-58 36.2-93.9 2.1-37 2.1-147.8 0-184.8zM398.8 388c-7.8 19.6-22.9 34.7-42.6 42.6-29.5 11.7-99.5 9-132.1 9s-102.7 2.6-132.1-9c-19.6-7.8-34.7-22.9-42.6-42.6-11.7-29.5-9-99.5-9-132.1s-2.6-102.7 9-132.1c7.8-19.6 22.9-34.7 42.6-42.6 29.5-11.7 99.5-9 132.1-9s102.7-2.6 132.1 9c19.6 7.8 34.7 22.9 42.6 42.6 11.7 29.5 9 99.5 9 132.1s2.7 102.7-9 132.1z"/></svg>
          </div>
          <div className='twitter'>
          <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 512 512"><path d="M389.2 48h70.6L305.6 224.2 487 464H345L233.7 318.6 106.5 464H35.8L200.7 275.5 26.8 48H172.4L272.9 180.9 389.2 48zM364.4 421.8h39.1L151.1 88h-42L364.4 421.8z"/></svg>
          </div>


        </div>
      </div>

    </div>
  );
}
